import Link from 'next/link';
import Navbar from '../component/layouts/navbar';

const App = () => {
    return(
        <Navbar>
            <div>
                <button type="button" class="btn btn-secondary">Right</button>
            </div>
        </Navbar>
    )
}

export default App;
